Transactions_Trend_1.query:
q = load "${App.Datasets.TransactionJournal7.FullyQualifiedName}";
q = filter q by 'Status' == "Processed" && 'JournalType_Name' == "Accrual";
dummy = foreach q generate "1970" as 'Year', "01" as 'Month', "01" as 'Day';
dummy = group dummy by ('Year', 'Month', 'Day');
dummy = foreach dummy generate 'Year', 'Month', 'Day', 0 as 'Value';
dummy = fill dummy by (dateCols=('Year','Month','Day', "Y-M-D"));
dummy = timeseries dummy generate 'Value' as 'Value1' with (length = 30000, dateCols=('Year','Month','Day', "Y-M-D"));
dummy = group dummy by ('Year', 'Month', 'Day');
dummy = foreach dummy generate 'Year', 'Month', 'Day', 0 as 'Test';
dummy = filter dummy by {{row(ActivityDate_1.selection, [0], ["min", "max"]).asDateRange("date('Year','Month','Day')")}};
result = group dummy by ('Year', 'Month') left, q by ('ActivityDate_Year', 'ActivityDate_Month');
result = foreach result generate coalesce(dummy.'Year' + "~~~" + dummy.'Month', q.'ActivityDate_Year' + "~~~" + q.'ActivityDate_Month') as 'ActivityDate_Year~~~ActivityDate_Month', count(q) as 'Count', sum(q.'TransactionAmount') as 'TransactionAmount';
result = order result by ('ActivityDate_Year~~~ActivityDate_Month' asc);
result = limit result 2000;

Descriptive_KPIs_1.query:
TransactionJournal = load "${App.Datasets.TransactionJournal7.FullyQualifiedName}";
TransactionJournal = filter TransactionJournal by 'JournalType_Name' == "Accrual" && 'Status' == "Processed" && 'LoyaltyProgramMember_ProgramId' == "{{cell(GetMemberDetails_1.result, 0, "LoyaltyProgramMember_ProgramId").asString()}}";
LoyaltyLedger = load "${App.Datasets.LoyaltyLedger7.FullyQualifiedName}";
LoyaltyLedger = filter LoyaltyLedger by 'TransactionJournal_LoyaltyProgramMember_ProgramId' == "{{cell(GetMemberDetails_1.result, 0, "LoyaltyProgramMember_ProgramId").asString()}}";
NQP_redeemption = filter LoyaltyLedger by 'TransactionType' == "Redemption";
LlyMemberCurrency = load "${App.Datasets.LoyaltyMemberCurrency7.FullyQualifiedName}";
LlyMemberCurrency = filter LlyMemberCurrency by 'LoyaltyProgramMember_ProgramId' == "{{cell(GetMemberDetails_1.result, 0, "LoyaltyProgramMember_ProgramId").asString()}}";
result = group TransactionJournal by 'MemberId' full,  LoyaltyLedger by 'LoyaltyProgramMemberId' full, NQP_redeemption by 'LoyaltyProgramMemberId' full, LlyMemberCurrency by 'LoyaltyMemberId';
result = foreach result generate coalesce(TransactionJournal.'MemberId', LoyaltyLedger.'LoyaltyProgramMemberId', NQP_redeemption.'LoyaltyProgramMemberId', LlyMemberCurrency.'LoyaltyMemberId') as 'LoyaltyProgramMemberId', sum(LoyaltyLedger.'Total_Accrued_Points') as 'sum_NQP_Accrued_Points', case when sum(LoyaltyLedger.'Total_Accrued_Points') is not null then rank() over ([..] partition by all order by sum(LoyaltyLedger.'Total_Accrued_Points')) end as 'rank_NQP_Accrued_Points', sum(NQP_redeemption.'Points') as 'sum_NQP_Redeemed_Points', case when sum(NQP_redeemption.'Points') is not null then rank() over ([..] partition by all order by sum(NQP_redeemption.'Points')) end as 'rank_NQP_Redeemed_Points', sum(TransactionJournal.'TransactionAmount') as 'sum_TransactionAmount', case when sum(TransactionJournal.'TransactionAmount') is not null then rank() over ([..] partition by all order by sum(TransactionJournal.'TransactionAmount')) end as 'rank_TransactionAmount', sum(LlyMemberCurrency.'PointsBalance') as 'sum_PointsBalance', case when sum(LlyMemberCurrency.'PointsBalance') is not null then rank() over ([..] partition by all order by sum(LlyMemberCurrency.'PointsBalance')) end as 'rank_PointsBalance';
result = group result by 'LoyaltyProgramMemberId';
result = foreach result generate 'LoyaltyProgramMemberId', first('rank_NQP_Accrued_Points')/ max(first('rank_NQP_Accrued_Points')) over ([..] partition by all) as 'NQP_Accrued_Points_Percentile', first('rank_NQP_Redeemed_Points')/ max(first('rank_NQP_Redeemed_Points')) over ([..] partition by all) as 'NQP_Redeemed_Points_Percentile', first('rank_TransactionAmount')/ max(first('rank_TransactionAmount')) over ([..] partition by all) as 'TransactionAmount_Percentile', first('rank_PointsBalance')/ max(first('rank_PointsBalance')) over ([..] partition by all) as 'PointsBalance_Percentile';
result = filter result by 'LoyaltyProgramMemberId' == "{{cell(GetMemberDetails_1.result, 0, "MemberId").asString()}}";
result = foreach result generate 'LoyaltyProgramMemberId', coalesce('{{coalesce(cell(Static_KPI_1.selection, 0, "Metric"), 0).asString()}}',0) as 'Selected_Percentile', round(coalesce('{{coalesce(cell(Static_KPI_1.selection, 0, "Metric"), 0).asString()}}',0)*100, 0) as 'Selected_Percentile_Rounded', case when '{{coalesce(cell(Static_KPI_1.selection, 0, "Metric"), 0).asString()}}' is not null then "Member is in " else " " end as 'Start_Text', case when '{{coalesce(cell(Static_KPI_1.selection, 0, "Metric"), 0).asString()}}' is not null then "on the basis of" else "                                      " end as 'End_Text', case when '{{coalesce(cell(Static_KPI_1.selection, 0, "Metric"), 0).asString()}}' is not null then +"percentile" else "No Data                         " end as 'Percentile_Text';

MemberRank_1.query:
